import React, {Component} from "react";
import CallingElement from "./CallingElement";
import ImageRDV from "./rdv.png";
import Style from "./Strategy.module.scss";

export default class CallingList extends Component{

    render() {
        return (
            <>
                <div className="row">
                {this.props.listPlayers.map((f, index) =>
                    <CallingElement order={index} player={f}/>
                )}
                </div>
            </>
        );
    }
}
